def count_vowels(strings):
    vowels = {'', 'e', 'i', 'o', 'u'}
    counts = {}
    for string in strings:
        count = 0
        for char in string:
            if char.lower() in vowels:
                count += 1
        counts[string] = count
    sorted_counts = sorted(counts.items(), key=lambda x: (-x[1], x[0]))
    return dict(sorted_counts)

